<!doctype html>
<html>
<head>
  <meta charset="utf-8" />
  <style>
    body {
      font-family: sans-serif;
      margin: 20px;
      display: flex;
      flex-direction: column;
      height: 100vh;
      gap: 10px;
    }

    .hidden { display: none !important; }

    /* Tabs */
    #tabs {
      display: flex;
      gap: 8px;
      flex-wrap: wrap;
      align-items: center;
    }
    .tab-btn {
      padding: 8px 12px;
      border-radius: 999px;
      border: 1px solid #ddd;
      background: #fff;
      cursor: pointer;
      font-weight: 600;
      color: #333;
    }
    .tab-btn[aria-selected="true"] {
      background: #111;
      color: #fff;
      border-color: #111;
    }

    /* Controls */
    #controls {
      padding: 15px;
      background: #f4f4f4;
      border-radius: 8px;
      display: flex;
      gap: 20px;
      align-items: center;
      flex-wrap: wrap;
    }
    select { padding: 6px; border-radius: 6px; }
    .legend-info { font-size: 0.9em; color: #666; }

    /* Layout */
    .container {
      flex: 1;
      display: grid;
      grid-template-columns: 1fr;
      gap: 12px;
      min-height: 0;
    }
    .panel {
      flex: 1;
      min-height: 0;
    }

    /* Media cards */
    .media-card {
      background: #fafafa;
      border: 1px solid #eee;
      border-radius: 10px;
      padding: 12px;
      min-height: 280px;
      display: flex;
      flex-direction: column;
      gap: 10px;
      min-height: 0;
    }
    .media-title {
      font-weight: 700;
    }
    .media-wrap {
      flex: 1;
      min-height: 0;
      display: flex;
      align-items: center;
      justify-content: center;
    }

    /* Gallery */
    #concept-figure-gallery {
      width: 100%;
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
      gap: 10px;
      align-items: start;
    }
    #concept-figure-gallery img {
      width: 100%;
      height: auto;
      border-radius: 8px;
      border: 1px solid #eee;
      background: #fafafa;
    }

    /* Videos */
    video {
      max-width: 100%;
      max-height: 70vh;
      border-radius: 10px;
    }

    #failure-video-gallery {
        width: 100%;
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(260px, 1fr));
        gap: 10px;
        align-items: start;
        }

    .failure-video-item {
        border: 1px solid #eee;
        background: #fafafa;
        border-radius: 10px;
        padding: 10px;
        display: flex;
        flex-direction: column;
        gap: 8px;
        }

    .failure-video-item video {
        width: 100%;
        height: auto;
        max-height: 50vh;
        border-radius: 10px;
        }

    /* PCA placeholder styling */
    #pca-plot {
      width: 100%;
      height: 100%;
      min-height: 60vh;
      border: 1px dashed #ddd;
      border-radius: 10px;
      background: #fff;
      display: flex;
      align-items: center;
      justify-content: center;
      color: #666;
      padding: 12px;
      box-sizing: border-box;
    }
  </style>
</head>

<body>
  <!-- Tabs -->
  <div id="tabs" role="tablist" aria-label="Views">
    <button class="tab-btn" id="tab-concepts" role="tab" aria-selected="true" aria-controls="panel-concepts">
      Concepts
    </button>
    <button class="tab-btn" id="tab-pca" role="tab" aria-selected="false" aria-controls="panel-pca">
      PCA Plot
    </button>
    <button class="tab-btn" id="tab-failures" role="tab" aria-selected="false" aria-controls="panel-failures">
      Failed Scenarios
    </button>
  </div>

  <!-- Controls (we'll show/hide per tab) -->
  <div id="controls">
    <!-- Concepts controls -->
    <div id="controls-concepts">
      <strong>SAE Concepts:</strong>
      <select id="feature-selector"></select>
      <div class="legend-info">Pick a concept to load its figure/video.</div>
    </div>

    <!-- Failures controls -->
    <div id="controls-failures" class="hidden">
      <strong>Failed Scenarios:</strong>
      <select id="failure-selector"></select>
      <div class="legend-info">Pick a failed scenario to view videos.</div>
    </div>

    <!-- PCA controls (optional placeholder, hidden by default) -->
    <div id="controls-pca" class="hidden">
      <div class="legend-info">Interactive PCA plot view.</div>
    </div>
  </div>

          <video id="concept-video" class="hidden" controls muted playsinline></video>

          <div id="concept-no-media" class="legend-info">
            Select a concept to view its associated assets.
          </div>
        </div>
      </div>
    </div>

        for (const c of byCat.get(cat)) {
          const opt = document.createElement("option");
          opt.value = c.id;
          opt.textContent = c.label;
          group.appendChild(opt);
        }
        sel.appendChild(group);
      }

      sel.addEventListener("change", updateConceptView);
    }

    function buildFailureSelector() {
      const sel = document.getElementById("failure-selector");
      sel.innerHTML = "";

      for (const s of FAILED_SCENARIOS) {
        const opt = document.createElement("option");
        opt.value = s.id;
        opt.textContent = s.label;
        sel.appendChild(opt);
      }

      sel.addEventListener("change", updateFailureView);
    }

    // -----------------------------
    // Concepts rendering
    // -----------------------------
    function updateConceptView() {
      const sel = document.getElementById("feature-selector");
      const id = sel.value;
      const concept = CONCEPTS.find(c => c.id === id);

      const title = document.getElementById("concept-media-title");
      const gallery = document.getElementById("concept-figure-gallery");
      const vid = document.getElementById("concept-video");
      const noMedia = document.getElementById("concept-no-media");

      // Reset gallery
      gallery.innerHTML = "";
      setHidden(gallery, true);

      if (!concept || concept.id === "none") {
        title.textContent = "None selected";
        stopVideo(vid);
        setHidden(vid, true);
        setHidden(noMedia, false);
        noMedia.textContent = "Select a concept to view its associated assets.";
        return;
      }

      title.textContent = `${concept.label}    ${concept.category}`;

      // Figures: support concept.figures[] or concept.figure
      const figs = Array.isArray(concept.figures) ? concept.figures
                 : (concept.figure ? [concept.figure] : []);

      if (figs.length > 0) {
        for (const src of figs) {
          // skip obviously empty placeholders if you want:
          // if (!src || src.endsWith("/")) continue;
          const img = document.createElement("img");
          img.src = src;
          img.alt = concept.label;
          gallery.appendChild(img);
        }
        if (gallery.childElementCount > 0) setHidden(gallery, false);
      }

      // Video
      if (concept.video) {
        vid.pause();
        vid.src = concept.video;
        vid.load();
        setHidden(vid, false);
      } else {
        stopVideo(vid);
        setHidden(vid, true);
      }

      const hasAny = (gallery.childElementCount > 0) || Boolean(concept.video);
      setHidden(noMedia, hasAny);
      if (!hasAny) noMedia.textContent = "No media mapped for this concept yet.";
    }

    // -----------------------------
    // Failures rendering
    // -----------------------------
    function inferOutcomeFromPath(path) {
            const p = String(path || "").toLowerCase();
            if (p.includes("success")) return "Success";
            if (p.includes("failure")) return "Failure";
            return "Video";
            }

            function inferTrialFromPath(path) {
            const m = String(path || "").match(/trial(\d+)/i);
            return m ? `Trial ${m[1]}` : null;
            }

    function inferOutcomeFromPath(path) {
        const p = String(path || "").toLowerCase();
        if (p.includes("success")) return "Success";
        if (p.includes("failure")) return "Failure";
        return "Video";
        }

    function inferTrialFromPath(path) {
        const m = String(path || "").match(/trial(\d+)/i);
        return m ? `Trial ${m[1]}` : null;
        }


    function updateFailureView() {
        const sel = document.getElementById("failure-selector");
        const id = sel.value;
        const scenario = FAILED_SCENARIOS.find(s => s.id === id);

        const title = document.getElementById("failure-media-title");
        const gallery = document.getElementById("failure-video-gallery");
        const noMedia = document.getElementById("failure-no-media");

        // Reset gallery
        gallery.innerHTML = "";
        setHidden(gallery, true);

        if (!scenario || scenario.id === "none") {
            title.textContent = "None selected";
            setHidden(noMedia, false);
            noMedia.textContent = "Select a failed scenario to view its video.";
            return;
        }

        title.textContent = scenario.label;

        // Normalize into an array of src strings
        const srcs =
            Array.isArray(scenario.videos) ? scenario.videos.filter(Boolean) :
            (scenario.video ? [scenario.video] : []);

        if (srcs.length === 0) {
            setHidden(noMedia, false);
            noMedia.textContent = "No video mapped for this failed scenario yet.";
            return;
        }

        // Render all videos side-by-side
        for (const src of srcs) {
            const item = document.createElement("div");
            item.className = "failure-video-item";

            const v = document.createElement("video");
            v.controls = true;
            v.muted = true;
            v.playsInline = true;
            v.src = src;

            const caption = document.createElement("div");
            caption.className = "legend-info";
            const outcome = inferOutcomeFromPath(src);
            const trial = inferTrialFromPath(src);
            caption.textContent = trial ? `${outcome}  ${trial}` : outcome;

            item.appendChild(v);
            item.appendChild(caption);
            gallery.appendChild(item);
        }

        setHidden(gallery, false);
        setHidden(noMedia, true);
        }


    

    // -----------------------------
    // Tabs
    // -----------------------------
    function stopAllVideosIn(el) {
  if (!el) return;
  el.querySelectorAll("video").forEach(v => {
    v.pause();
    v.removeAttribute("src");
    v.load();
  });
}

    function setActiveTab(tabName) {
      const tabs = [
        { name: "concepts", btn: "tab-concepts", panel: "panel-concepts", controls: "controls-concepts" },
        { name: "pca",      btn: "tab-pca",      panel: "panel-pca",      controls: "controls-pca" },
        { name: "failures", btn: "tab-failures", panel: "panel-failures", controls: "controls-failures" },
      ];

      for (const t of tabs) {
        const isActive = (t.name === tabName);
        const btn = document.getElementById(t.btn);
        const panel = document.getElementById(t.panel);
        const controls = document.getElementById(t.controls);

        btn.setAttribute("aria-selected", String(isActive));
        setHidden(panel, !isActive);
        setHidden(controls, !isActive);
      }

      // Optional: stop videos when leaving their tab
      if (tabName !== "concepts") stopVideo(document.getElementById("concept-video"));
      if (tabName !== "failures") stopAllVideosIn(document.getElementById("failure-video-gallery"));
    }

    function initTabs() {
      document.getElementById("tab-concepts").addEventListener("click", () => setActiveTab("concepts"));
      document.getElementById("tab-pca").addEventListener("click", () => setActiveTab("pca"));
      document.getElementById("tab-failures").addEventListener("click", () => setActiveTab("failures"));
    }

    // -----------------------------
    // Init
    // -----------------------------
    initTabs();

    buildConceptSelector();
    document.getElementById("feature-selector").value = "none";
    updateConceptView();

    buildFailureSelector();
    document.getElementById("failure-selector").value = "none";
    updateFailureView();

    setActiveTab("concepts");
  </script>
</body>
